def get_SR_word():
        '''
        this func used to get a SR word 
        can be used in terminal as:  import sr_words;  print(sr_words.get_SR_word())
        '''
        from speech_recognizer import isolated_word
        from fpioa_manager import fm
        from Maix import I2S
        import time
        # mic initiation
        fm.register(20,fm.fpioa.I2S0_IN_D0, force=True)
        fm.register(18,fm.fpioa.I2S0_SCLK, force=True)
        fm.register(19,fm.fpioa.I2S0_WS, force=True)
        # init i2s0
        mic_dev = I2S(I2S.DEVICE_0)
        mic_dev.channel_config(mic_dev.CHANNEL_0, mic_dev.RECEIVER, align_mode=I2S.STANDARD_MODE)
        mic_dev.set_sample_rate(16000)
        # init SR
        sr = isolated_word(dmac=2, i2s=I2S.DEVICE_0, size=20, shift=0)
        # threshold
        sr.set_threshold(0, 0, 10000)
        # get data
        data = None
        while True:
                time.sleep_ms(100)
                #print(sr.state())
                if sr.Done == sr.record(0):
                        data = sr.get(0)
                        sr.__del__()
                        del sr
                        return data
                if sr.Speak == sr.state():
                        print('speak now...')
